import "./Card.css";
import Carousels from './Carousels';

function Card ({title, imgSrc, imgAlt, text, selectPage, path}){
    return (
        <>
            <div>
                <Carousels images={imgSrc}/>
            </div>
            <div className="cat_card__pic">
                <img
                    src={imgSrc}
                    alt={imgAlt}
                />
            </div>
            <div className="cat_card__text">
                <h3 className="cat_card__title">{title}</h3>
                <p>{text}</p>

            </div>
            {path !== "" && <div className="cat_card__subscribe">
                <button type="button" className="open_subscribe">
                    <a className="cat_card__link" href={path} onClick={e => {
                        selectPage(e);
                    }}>
                        "More About Us"
                    </a>
                </button>
            </div>}
        </>
    )
}
export default Card;
